import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';

import { AppComponent } from './app.component';
import { HeroComponent } from './components/hero/hero.component';
import { ProjectsGalleryComponent } from './components/projects-gallery/projects-gallery.component';
import { ProjectCardComponent } from './components/project-card/project-card.component';
import { SkillsGalleryComponent } from './components/skills-gallery/skills-gallery.component';
import { ContactComponent } from './components/contact/contact.component';
import { FooterComponent } from './components/footer/footer.component';
import { NavComponent } from './components/nav/nav.component';

@NgModule({
  declarations: [AppComponent, HeroComponent, ProjectsGalleryComponent, ProjectCardComponent, SkillsGalleryComponent, ContactComponent, FooterComponent, NavComponent],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FormsModule,
    RouterModule.forRoot([]),
  ],
  providers: [],
  bootstrap: [AppComponent],
})
export class AppModule {}
